export default {

    //splashscreen
    splashScreen: {
      flex: 1,
      flexDirection: "column",
      justifyContent: "center",
      alignItems: "center",
      backgroundColor: "#03255F",
    },
  
    smartApps: {
      fontSize: 12,
      color: "white",
      fontWeight: "bold",
      marginBottom: 50,
    },
  background: {
    backgroundColor: "#03255F",
    height: "100%",
    alignItems: "center",
  },
  splashScreen: {
    flex: 1,
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "#03255F",
  },
  logo: {
    width: 300,
    height: 100,
    resizeMode: "center",
    marginTop: 100,
    marginBottom: 50,
  },
  button: {
    width: 300,
    height: 50,
    backgroundColor: "#F5C300",
    alignItems: "center",
    justifyContent: "center",
    marginTop: 10,
    marginBottom: 10,
    borderRadius: 8,
    borderWidth: 1,
  },
  text: {
    fontSize: 15,
    color: "white",
    fontWeight: "bold",
  },

  input: {
    height: 50,
    color: "#fff",
    width: 300,
    marginBottom: 25,
    backgroundColor: "#1e3040",
    paddingHorizontal: 20,
    borderRadius: 50,
    fontSize: 18,
    borderWidth: 1,
    borderColor: "#1e3040",
  },

  error: {
    borderColor: "#940c0c",
  },
  login: {
    flex: 1,
    justifyContent: "flex-end",
    marginBottom: 10,
  },

  register: {
    flex: 1,
    justifyContent: "flex-end",
    marginBottom: 10,
  },
  //statusindicator

  containerStatus: {
    flex: 1,
    justifyContent: "center",
  },
  horizontal: {
    flexDirection: "row",
    justifyContent: "space-around",
    padding: 10,
  },
};
